div style="text-align: justify;"
Mit einem Outfit Inspiration Post melde ich mich im neuen Jahr zurück! Schon sehr lange gab es keine Inspirationen mehr hier auf dem Blog und da es draußen momentan sehr winterlich ist, habe ich ein paar Outfits für kalte Tage gebastelt. Eingebaut habe ich natürlich meine aktuellen Lieblingsfarben für den Winter: Sand, Taupe, Grau und natürlich Schwarz. Klassiker wie UGG Boots dürfen bei mir im Winter nicht fehlen, außerdem mag ich momentan karierte Schals und kuschelige lange Westen. div
